export default function Header(){

    return (
        <div className="header">

            <h1 className="tittle">TattooKing</h1>

            <input className="search" type="text" placeholder="Search "><img src="/search.svg" alt="Vercel Logo" className="logo" /></input>
            
            <div>
                <h2 className="login-header">Log In</h2>

                <h2 className="login-header">Sign In</h2>
            </div>   
        </div>
    )


}
